import titles from "../static/css/playdetail.module.css"
export default function DetailTitle(props){
    console.log(props)
    //拿取父组件传递的信息，分离需要信息
    let {data} = props
    return(
        <Fragment>
            {data?
            <div className={""}>
                <div className={titles.detailCoverImg}>
                    <img src={data.coverImgUrl} className="j-img"/>
                    <span className={titles.cover}></span>
                </div>
            </div>:""}
        </Fragment>
    )
}
